import './App.css';
import Expense from './Components/Expense';


function App() {
  const expense=[
    {
      title:"car Insurance",
      price:24.15,
      date: new Date(2021, 3, 23),
    },
    {
      title:"paper Insurance",
      price:60.15,
      date:new Date (2020, 4, 13),
    }
  ]
  return (
    <div className="App">
    <Expense items={expense} />
    </div>
  );
}

export default App;
